import React from 'react';


function CoinList({ coins }) {
    //console.log("55",);
    return (
        <ul>
            {
                coins.map(coin => (
                    <li key={Object.keys(coins.data)}>
                        {Object.keys(coins.data)}
                    </li>
                ))
            }
        </ul>
    )
};

export default CoinList;
